"use strict";

const BinaryStoreError = require("./binarystore-error.js");

class ExpiredLock extends BinaryStoreError {
  constructor(cause, message) {
    super(message || "UuBinary lock expired.", cause);
    this.code = `${BinaryStoreError.ERROR_PREFIX}expiredLock`;
  }
}

module.exports = ExpiredLock;
